INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (6, 'Mauspad SteelSeries QcK Heavy M', 'Ky mauspad është krijuar nga materiale cilësore me qëndrueshmëri të lartë. Është i përshtatshëm për maus optikë dhe laserikë. Lahet lehtë dhe pjesa përfundi ka sipërfaqe të parrëshqitshme. Përmasat e tij janë 320 x 270 x 6 mm.', '66cdbf9023de4e6ebde21fd71d3da2fd.webp', 11, 8, 'false');
