INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (9, 'Dron Overmax X-Bee, 600 m, i zi', '', '59b6afb8c802426a8e5f500e4026f43c.webp', 14, 9, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (10, 'Dron DJI Tello EDU, i zi', 'Tello EDU është një dron i programueshëm i krijuar për edukim. Me të, ju mund të mësoni lehtësisht gjuhë programimi si Scratch, Python dhe Swift. Falë SDK 2.0 të përmirësuar, Tello EDU është në gjendje të ekzekutojë komanda të avancuara. Për më tepër, droni është pajisur edhe me ndërfaqe të gjera të të dhënave. I pajisur me teknologjinë e kontrollit të fluturimit të DJI, Tello EDU mbështet stabilizimin elektronik të imazhit. Shumë drone Tello EDU mund të programohen njëkohësisht me një pajisje. Shkruani kodin për të kontrolluar formacionet e dronëve mbi dyshekë të veçantë dhe për të kryer marifete të ndryshme. Bëhuni një mjeshtër programimi ndërsa zhvilloni krijimtarinë tuaj!', '0d5e956bbfea428f9a34cc7931a35410.webp', 13, 9, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (11, 'Kasë Thermaltake Core P3, e bardhë', 'Core P3 TG është një kasë me kornizë të hapur me aftësi të jashtëzakonshme shikimi. Paneli i përparmë i xhamit të kalbur me trashësi 5 mm garanton qëndrueshmërinë e dritares dhe e shfaq ndërtimin tuaj me qartësi të qartë. Përdoruesit mund të shikojnë plotësisht çdo komponent të sistemit dhe të tregojnë përkushtimin dhe grupin e aftësive të tyre. Kasa është e përshtatshme me pllakat amë ATX, Micro ATX (uATX), Mini ITX. Mund të instaloni kartë grafike me gjatësi maksimale 45cm. Në panelin e përparmë kasa ka 2x USB 2.0, 2x USB 3.0, lidhës për kufje dhe mikrofon.', '1d57a7fd4eb84e4591d6dfb646e92183.webp', 12, 10, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (12, 'Flutur ftohëse Arctic P14 PWM - 140 mm', '', '7a9c6afa06244dc3971c304782997ff4.webp', 23, 10, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (13, 'Memorie G. Skill DDR4, 8 GB, 2400 MHz, CL17', 'Memoria e tillë G.Skill RAM prej 8 GB do të garantojë komoditet të lartë përdorimi për shumë aplikacione. Njerëzit që presin performancë maksimale dhe kursime të larta të energjisë duhet të arrijnë te memoria DDR4. Një memorie e tillë do tju lejojë të argëtoheni me performancë të shkëlqyer të operimit. Nëse kompjuteri ngadalësohet pas njëfarë kohe, do të jetë e mundur të zgjerohet memoria RAM. Vonesa CL17 do tju lejojë të punoni rehat me programet e zyrës, si dhe me shumë lojëra kërkuese. Tensioni prej 1.2 V fuqizon çipat e memories DDR4, që do të thotë 20% konsum më të ulët të energjisë në krahasim me DDR3 dhe gjerësi bande më të lartë. Ky variant do të jetë një zgjidhje perfekte për përdoruesit që presin punë të rehatshme dhe, në të njëjtën kohë, kursime të larta të energjisë.', '518028ed2190457dae312b34de40967d.webp', 15, 10, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (14, 'SSD Transcend MTE220S, M.2 - 256GB', '', '4dfe5a3c118e4850988b3bf9099bac51.webp', 24, 17, 'false');
