INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (19, 'Hard disk WD SSD SN550 Gen3, M.2 - 250GB', 'Ky hard disk i shpejtë dhe i besueshëm me format SSD M.2 2280 është dizajnuar për laptopë dhe kompjuterë. Ka ndërfaqe PCle NVMe 3.0 x 4 dhe kapacitet 250 GB. Arrin shpejtësi leximi 3300 MB/s dhe shkrimi 1200 Mb/s. Është rezistent ndaj tronditjeve.', '53c424b9369f4658a8b8cd1be24916a6.webp', 23, 17, 'false');
