INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (23, 'Apple iMac 24", M3 8-core, 8GB, 256GB, 8-core GPU, Pink', 'Njihuni me Apple iMac 24" M3, një kompjuter desktop elegant dhe i fuqishëm, All-in-one që riimagjinon përvojën tuaj informatike me stil dhe performancë. Ky iMac i jashtëzakonshëm kombinon teknologjinë e fundit me një dizajn elegant, duke e bërë atë shtesën e përsosur për çdo moderne hapësirën e punës. Në thelb të Apple iMac 24" M3 është procesori i fuqishëm M3, që ofron performancë mbresëlënëse për një gamë të gjerë detyrash. Pavarësisht nëse jeni duke punuar në projekte kreative, duke menagjuar biznesin tuaj ose duke shijuar përmbajtje multimediale, procesori M3 siguron që gjithçka funksionon pa probleme dhe me efikasitet.
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (24, 'Projektor Acer H6542BDK, i bardhë', 'Projektori Acer H6542BDK është një projektor kompakt dhe i lehtë që transportohet lehtë dhe për këtë arsye është një ndihmës ideal për prezantime të ndryshme biznesi, por edhe për projektimin në shtëpi. Projektori përdor teknologjinë DLP, e cila gjithashtu ofron cilësi të shkëlqyera të ekranit 3D, video më të butë, kontrast më të lartë me ngjyra realiste. Krijon një imazh të mprehtë me saktësi të paparë të ekranit dhe një shkallë të lartë rifreskimi. Projektori është i pajisur me një port HDMI, falë së cilës është e mundur të lidhni shpejt dhe me lehtësi pajisje të ndryshme burimore me rezolucion të lartë imazhi. Projektori ofron ndriçim prej 4000 lm, rezolucion HD 1920 x 1080 dhe kontrast 10000:1. Jetëgjatësia e llambës në modalitetin super eko deri në 20,000 orë, opsioni i projektimit me wireless. Ka altoparlant 1 x 3 W. Pesha e projektorit është 2.6 kg.', 'aede0480b5e14517a1fc09617b97e934.webp', 20, 7, 'false');
