INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (27, 'Apple Macbook Pro 16", M3 Pro 12-Core, 36GB, 512GB, 16-Core GPU, Space Black', 'Njihuni me Apple MacBook Pro 16" M3 Pro, një laptop me performancë të lartë që ripërcakton kufijtë e kompjuterit portativ. Kjo pajisje është projektuar posaçërisht për të përmbushur nevojat e profesionistëve, krijuesve dhe përdoruesve të fuqishëm që kërkojnë fuqi të pashembullt përpunuese, me bujari ekran me përmasa dhe risitë më të fundit në teknologji. Në thelb të Apple MacBook Pro 16" M3 Pro është procesori i mrekullueshëm M3 Pro, duke vendosur një standard të ri për performancën e laptopit. Me aftësitë e tij mbresëlënëse të përpunimit dhe veçoritë e avancuara të multitasking, ai trajton pa mundim detyra që kërkojnë burime intensive, nga redaktimi i videos dhe 3D pasqyrim në analizën e të dhënave dhe më gjerë. Pavarësisht nga kompleksiteti i ngarkesës suaj të punës, M3 Pro siguron një përvojë të shpejtë dhe efikase.
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (28, 'Kufje Logitech G432, të zeza', 'Kufje të fuqishme por shumë të rehatshme 50mm. X 2.0 mbështetja e zërit shtesë e gjeneratës së ardhshme. Dizajnuar për përdorim me të gjitha platformat e lojërave dhe pajisjet mobile, USB DAC dhe lidhës 3.5mm. Ata janë në përputhje me PC, Mac, PS4, Xbox One, Nintendo Switch dhe gjithashtu me pajisje të lëvizshme. Mikrofoni 6mm me funksionin "mute". 107 dB ndjeshmëri SPL / MW. Përgjigjja frekuencore 20 - 20,000 Hz. Impedancë 39 Ohm (pasive), 5 kiloohm (aktive). Gjatësia e kabllit 2 m. Të lehta me peshë prej 303 g (me kabllo). Përmasat 172 x 81.7 x 182 mm.', '9dff6b0719484b41881e43349a3fca45.webp', 6, 5, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (29, 'Hard disk Samsung SSD 970 EVO PLUS, M.2 - 250GB', '', 'f28634dafdc1428fa1cf54e7cac60386.webp', 10, 17, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (30, 'Disk portativ WD Elements, 2TB, i zi', 'WD Elements ofron një hard disk portativ dhe modern. Me kapacitet 2 TB dhe peshë të lehtë (vetëm 230 gram), ofron shumë hapësirë për një sërë të dhënash. Pjesa e tij përbërëse është një mbulesë e fortë, duke e bërë diskun më rezistent ndaj dëmtimit. Ruajtja mbështet pa probleme pajisjet e fundit USB 3.0 dhe gjithashtu është i pajtueshëm me kompjuterët USB 2.0. Pajisja në modalitetin USB 3.0 transferon deri në 5 Gb / s, nëse e lidhni atë me një kompjuter që mbështet USB 2.0, do të duhet të jeni më i ngadaltë, por gjithsesi i mjaftueshëm i shpejtë maksimal teorik deri në 480 Mb / s. Disku është i formatuar nga fabrika me NTFS dhe është në përputhje me Windows 8, Windows 7, Windows Vista dhe Windows XP. Ato mund të riformatohen pa vështirësi për sistemet Mac. Kjo bën të mundur që pronarët e kompjuterave me sisteme të ndryshme operative të përdorin diskun. Dimensionet e tij janë 21 x 111 x 82mm.', '8e11654e23464a9793fc4849cedea6b2.webp', 18, 17, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (31, 'Disk i jashtëm Transcend Jet 25H3B, 1 TB, i zi / kaltër', '', 'baa8b541acec455792c1b9e2173e5760.webp', 24, 17, 'false');
