INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (35, 'Celular Samsung Galaxy A23 5G, 6.6" FHD+, 4GB RAM, 128GB, i kaltër', 'This is a mobile phone with a 6.6" Full HD+ display and a 120 Hz refresh rate. It has a 50 MPx camera, an ultra-wide-angle lens, macro and depth sensors, and an 8 MPx front camera. It is powered by a Qualcomm Snapdragon 695 processor with 8 cores and 4 GB RAM, and has 128 GB of storage with the option to add up to 1 TB with a micro SD card. It supports LTE, Wi-Fi, Bluetooth v5.1, 5G, NF, GPS, BeiDou, QZSS, GLONASS, and Galileo. It runs on Android OS, has a 5000 mAh battery with Super Fast Charging 25W, and weighs 197 g with dimensions of 165.4 x 76.9 x 8.4 mm.', 'a0cadc38ee414583a5951fc7155d629e.webp', 10, 1, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (36, 'Apple Watch Ultra 2 Cellular, 49mm Titanium Case me Olive Alpine Loop, Large', '', '405e9c7b2bb74588866cbcdf2dbbbc4a.webp', 1, 3, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (37, 'Fotoaparat Fujifilm Instax MINI 12, rozë', 'Një aparat fotografik për marrjen e shpejtë të fotove të menjëhershme. Modaliteti makro nga 30 në 50 cm. Pasqyrë selfie dhe modaliteti selfie. Ekspozimi automatik. Viewfinder 0,37x, funksioni i korrigjimit të paralaksave në modalitetin Close-Up. Koha e zhvillimit të filmit përafërsisht. 90 sekonda. Mbyllje automatike pas 5 minutash. Mundësuar nga 2x bateri AA (LR6). Jetëgjatësia e baterisë përafërsisht 10 pako film. Pesha 306g (pa bateri, rrip dhe film). Përmasat 104 x 122 x 66.6 mm.', 'b2de81104d9a4ed19459f294c6c8fbf6.webp', 26, 4, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (38, 'Printer Canon PIXMA TS5150, i zi', 'PIXMA TS5150 është printer shumëfunksional me ngjyra dhe format A4. Ofron printim, skanim dhe kopjim. Është ideal për përdorim në shtëpi, përmban dy mbajtëse për fletë - para dhe prapa, secila për deri në 100 fletë. Ofron një rezolucion printimi deri në 4800 x 1200 dpi me një shpejtësi (bardhë / zi) prej 13 / 6.8 imazhe në minutë. Rezolucioni i skanerit është 1200 x 2400 me një shpejtësi skanimi prej 14 s (A4). Mund të përdorni fishekë ngjyre me vëllim të madh (PGI-540XL / CL-541XL). Për lidhje përdor ndërfaqen USB 2.0, Wi-Fi dhe mund të lidhet me cloud. Përmasat e tij janë 425 x 315 x 147 mm dhe peshon prej 6.5 kg.', '9afde1e52c5e4c66a47ffed453104716.webp', 27, 14, 'false');
