INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (42, 'Maus Preyon Owl Wireless (POW35B)', 'Mouse Preyon Owl është mouse gaming pa kabllo, mirëpo asgjë nuk pengon lidhjen e tij me një kabllo. Nëse bateria harxhohet, vetëm lidheni dhe mund të vazhdoni përdorimin e tij. Me 50milion klikime në përdorimin e këtij mausi që tregon për sigurinë që jepet kualitetit të këtij mausi. Me butona shtesë shumë lehtë kontrolloni vlerat DPI dhe frekuencën e përdorur. Me LED që tregojnë vlerën e selektuar lehtë.', '2b613b801002461586759fb29ec61417.webp', 30, 8, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (43, 'Apple 10.9-inch iPad (10th) Wi-Fi, 64GB, Silver', '', 'acd49f4b9a354b7baef255b1cc4a86ff.webp', 1, 12, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (44, 'Apple MagSafe Charger', '', '983ba613c43a46e9baf7efed8c9fd30d.webp', 1, 11, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (45, 'Apple AirPods (3rd generation) with Lightning Charging Case', N'AirPods janë të lehta dhe ofrojnë një dizajn të konturuar. Mikrofonat me pamje nga brenda zbulojnë atë që po dëgjoni, më pas rregullojnë frekuencat e rangut të ulët dhe të mesëm për të ofruar detaje të pasura në çdo këngë.rnrnAirPods kanë një jetëgjatësi shtesë të baterisë në krahasim me AirPods (gjenerata e dytë) deri në 6 orë kohë dëgjimi dhe deri në 4 orë kohë bisede. Dhe me kutinë e karikimit Lightning, mund të shijoni deri në 30 orë kohë totale të dëgjimit. Si AirPods ashtu edhe kasa e karikimit të Rrufesë janë vlerësuar me IPX4 rezistente ndaj ujit – kështu që do të përballojnë çdo gjë, nga shiu deri tek stërvitjet e rënda.', 'e958a0b50830453299e5bfdb73ef2586.webp', 1, 5, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (46, 'Karrige SENSE7 Spellcaster, e zezë/e kaltër', 'Karrigia SENSE7 Spellcaster ka një formë që i përshtatet lakimit natyror të shtyllës kurrizore dhe, si rezultat, siguron pozicionin e duhur përpara kompjuterit kur jeni duke luajtur ose duke punuar. Ajo plotësohet nga një mbushje sfungjer me dendësi optimale, e cila përshtatet me trupin dhe siguron rehati. Është projektuar për njerëzit me peshë maksimale 150 kg. Karrigia peshon 17.5kg.', '5fc2d0c9d9244edea857e024fa4691a8.webp', 29, 20, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (47, 'Kamerë Logitech StreamCam C980, e hirtë', 'Kjo është një kamerë transmetimi me cilësi të lartë. Ajo ofron një cilësi maksimale të regjistrimit prej 1080p në 60 korniza për sekondë. Ajo përdor ndërfaqen USB 3.2 Gen 1 lloji C për tu lidhur me pajisjen. Është e pajisur me një lente f / 2.0 me një gjatësi fokale prej 3.7 mm dhe një fushë shikimi prej 78 ° (diagonale). Ofron autofokus në një distancë prej 10 cm deri në pafundësi. Ka një mikrofon të dyfishtë gjithëpërfshirës të integruar me funksion të zvogëlimit të zhurmës. Gjatësia e kabllos është 1.5 m. Paketa përfshin një mbajtës për vendosjen e saj në monitor dhe një mbajtës statik.', '18ea146f141d4a749632e667bc6a8411.webp', 6, 4, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (48, 'Altoparlant JBL Clip 4, i kuq', 'Altoparlant unik portativ me fuqi dalëse 5 W RMS, përgjigje frekuence prej 100 Hz deri 20 kHz, raport sinjal-zhurmë > 85 dB, teknologji Bluetooth 5.1. Bateria e tij polimer litium-jon karikohet për 3 orë dhe zgjat deri në 10 orë. Përmasat e altoparlantit janë: 86.3 x 134.5 x 46 mm, pesha 239 g.', 'ddc006477a3f433b81153ba980cc13f9.webp', 4, 5, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (49, 'Ngjyrë për printer Canon PGI-571, e kaltërt', 'Ngjyra e kaltër Canon CLI-571 është në përputhje me printera Canon PIXMA MG5750, MG5751, MG5752, MG5753, MG6850, MG6851, MG6852, MG6853, MG7750, MG7751, MG7752, MG7753. Kjo ngjyrë ka një vëllim prej 7 ml.', '36252992c8744b9897f39e362d461f60.webp', 27, 14, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (50, 'Maus Razer Pro Click, i bardhë', 'Ky është një maus wireless i krijuar për përdoruesit e djathtë. Mausi ka lidhës USB, 8 butona dhe një rrotë mekanike. Ai ka teknologji wireless Bluetooth, sensor optik dhe ndjeshmëri maksimale 16,000 DPI.', 'adad9547e2fa4f1aa92759b1aaad9159.webp', 9, 8, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (51, 'Karikues Samsung EP-TA12 për Samsung micro USB, i zi', '', '5a148985c96c40e6a144b1fffd549452.webp', 10, 15, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (52, 'Apple 20W USB-C Power Adapter', 'Ky është një karikues i fuqishëm 20W, i cili përdoret për karikim të shpejtë dhe efikas në shtëpi, në zyrë dhe gjatë lëvizjes. Është i pajtueshëm me çdo pajisje USB-C, por për një performancë optimale të karikimit, Apple rekomandon përdorimin e tij me iPad Pro 11'' ose iPad Pro 12,9'' (gjenerata e tretë). Ai gjithashtu mbështet karikimin e shpejtë të iPhone 8.', '04cddd9ea27247bf87502369b3229402.webp', 1, 15, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (53, 'Gjirafa50 Bad News Eagles Jersey (Rio Edition) - XXL', 'Ndjeni emocionin e kualifikimit të dytë në Major me fanellën e Rio Edition të Bad News Eagles.rnrnKjo fanellë e cilësisë së lartë me dizajn modern, e krijuar posaçërisht për lojtarët pasionantë të sporteve elektronike, është krijuar me krenari krahas Gjirafa50.rnrnNgjyra e saj kryesore është e gjelbër, e njohur si ngjyra dominuese e flamurit kombëtar të Brazilit.rnrnFanella ka logon e personalizuar të ekipit BNE dhe është prej 100% poliestër.', 'a001687d93df4caba3bf2ef26799a5bd.webp', 31, 13, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (54, 'Gjirafa50 Bad News Eagles Jersey Legends Edition - S', 'Ndjeni emocionet e lojës me këtë fanellë të Legends Stage të Bad News Eagles të krijuar posaçërisht për lojtarët e apasionuar pas sporteve elektronike. Ngjyra kryesore e saj është e kuqja e kombinuar me detaje bardh e zi dhe ka logon e personalizuar të ekipit BNE. Fanella është prej 100% poliestër. Dimensionet janë 71 x 57 x 25.5 cm.rnrnKjo fanellë e cilësisë së lartë me dizajn modern është krijuar me krenari përkrah Gjirafa50.', 'a873f1d3601f429ba784a4199d4d5c3a.webp', 31, 13, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (55, 'Rrip metalik FIXED për Apple Watch 38/40/41mm, i argjendtë', 'Rrip metalik zëvendësues që është i pajtueshëm me Apple Watch 38/40 / 41mm. Ky rrip e kthen orën në një aksesor elegant që mund ta kombinoni lehtësisht me çdo veshje.', '8a667d8e2c5d48e18fe6678cd1b81974.webp', 35, 3, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (56, 'Mbrojtëse Lenuo Leshield për iPhone 13, e kuqe', 'Mbrojtëse për pjesën e pasme dhe anësore të celularit iPhone 13. Mbrojtësja është prej plastike të qëndrueshme dhe do të sigurojë mbrojtje të besueshme të celularit nga gërvishtjet dhe papastërtitë. Natyrisht, mbrojtësja ka prerje për kamerën, butonat dhe portin e karikimit. Ajo është e këndshme në prekje dhe e ruajtur mirë.', 'b17ff2f5eac14f289d0311c0edd789bf.webp', 32, 1, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (57, 'Procesor Intel Core i7-12700F', 'Ky është një procesor i gjeneratës së 12-të Alder Lake i krijuar për prizën LGA 1700. Ofron 8+4 bërthama fizike (8 performancë + 4 efektive, 20 threads). Frekuenca e tyre është 1.6/2.1 GHz dhe deri në 3.6/4.8 GHz në modalitetin Turbo (bërthama efikase/performancë). Frekuenca maksimale Turbo Boost është deri në 4.9 GHz. Ai ofron një memorie buffer 25 MB SmartCache dhe një proces prodhimi 10 nm është përdorur për krijimin e tij. Mbështet memorie deri në DDR5 4800 MHz dhe DDR4 3200 MHz. Mbështet ndërfaqen PCI-Express 5.0/4.0. TDP e deklaruar nga prodhuesi është 65 W (maksimumi 180 W).', '653c3cd335564c868f34dd8858149ac9.webp', 33, 10, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (58, 'Monitor Dell U3223QE - LED 31,5"', 'Dell U3223QE është një monitor 31.5" me rezolucion të lartë që do tju rrëmbejë me ngjyrën dhe elegancën e tij. Rezolucioni 4K (3840 x 2160) me më shumë se 8 milionë piksele ka një rezolucion 4 herë më të lartë se një monitor klasik Full HD. Ngjyrat janë të qarta dhe të qëndrueshme përgjatë këndit të shikimit. Dell UltraSharp P3222QE është një monitor që mendon gjithashtu për shëndetin tuaj. Falë funksionit ComfortView Plus, i cili garanton emetimin vazhdimisht të ulët të dritës blu, ju do të shijoni ngjyra të shkëlqyera.rnrnKarakteristikat e tjera të monitorit përfshijnë raporti i pamjes 16: 9, kontrasti 2000: 1, shpejtësia e rifreskimit 60 Hz, ndriçimi 400 cd / m2, koha e përgjigjes 8 ms në modalitetin normal ose 5 ms në modalitetin e shpejtë. Lidhësit: 1x DP, 1x HDMI, USB-C, 6x USB, 1x RJ-45, pivot. Dimensionet 71.26 cm x 61.88 cm x 23.32 cm, pesha 10.36 k', '21cb46b9af9f4a55bec3acd37ced80e7.webp', 25, 16, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (59, 'Kabllo AXAGON USB-A - micro USB 3.2 Gen 1 SPEED, 3A, 1m, e zezë', 'Kablloja AXAGON është e përshtatshme për laptopë, telefont, tabletë dhe pajisje e tjera celulare. Mbështet shpejtësinë e transferimit të të dhënave deri në 5 Gb / s dhe karikimin deri në 3A.', '9b6ad692b3cc44eca43ea30c012586f5.webp', 34, 15, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (60, 'Apple MacBook Air 13.3", M1 8-core, 8GB, 256GB, 7-core GPU, Space Grey', 'Gjenerata e re e MacBook Air nga Apple është një revolucion i vërtetë për sa i takon performancës së këtij laptopi kompakt. Ai ofron të gjitha tiparet dhe veçoritë tuaja të preferuara, por performanca është në një nivel tjetër. Me MacBook Air të ri, ju mund të redaktoni video me rezolucion të lartë e po ashtu të përfitoni nga aplikacionet profesionale.
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (61, 'Apple iPhone 14 Pro Max Silicone Case me MagSafe, Midnight', 'Kjo mbrojtëse e hollë dhe e lehtë Apple përshtatet në mënyrë të përkryer në dorën tuaj. Ajo mbron me besueshmëri iPhone 14 Pro Max dhe lejon që ngjyra e tij të spikasë. Është bërë nga një përzierje e polikarbonatit optikisht të pastër dhe materialeve fleksibël, rrethon në mënyrë perfekte butonat e celularit dhe nuk pengon në asnjë mënyrë funksionimin e tij. Është rezistente ndaj gërvishtjeve nga jashtë dhe brenda. Dhe materialet e saj të optimizuara nuk do të zverdhen edhe pas një kohe të gjatë. Me magnet të integruar që përputhen në mënyrë të përsosur me iPhone 14 Pro Max, karikimi wireless është më i shpejtë. Kur ju duhet të karikoni iPhone tuaj, thjeshtë lidhni karikuesin MagSafe në të me mbrojtëse ose vendoseni në karikuesin Qi.', '7fcb48f21fb3410688fcd264c0434263.webp', 1, 1, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (62, 'Televizor Samsung UE43TU7022UXXH, 43" (108cm), 4K, 2020, argjendtë', '', '08ab442392764ec5969c68479a8d9574.webp', 10, 7, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (63, 'Xham mbrojtës Spello by Epico për Samsung Galaxy S23 Ultra 5G, 3D+', '', 'a30ab4faf9204ff591747fc9125a95ff.webp', 47, 1, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (64, 'Apple Macbook Air 15", M2 8-Core CPU, 8GB, 256GB, 10-Core GPU, Midnight', N'Me MacBook Air 15.3”, të pajisur me një ekran mahnitës Liquid Retina, ju keni më shumë hapësirë për gjithçka që doni. MacBook Air 15 (M2) përfaqëson një kombinim mjeshtëror të butësisë dhe hollësisë, megjithatë ruan qëndrueshmëri të padiskutueshme dhe funksionim krejtësisht të heshtur. Me MacBook Air të ri (M2), ju do të arrini performancë të paprecedentë për detyra të vështira, të tilla si redaktimi i videos me definicion të lartë, dizajni grafik dhe aplikacione të tjera krijuese. Tani mund t''i realizoni idetë tuaja praktikisht kudo dhe në çdo kohë.
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (65, 'Apple Watch SE2 V2 GPS, 40mm, Midnight Aluminium Case me Midnight Sport Band, S/M', 'pple Watch SE është krijuar me saktësi dhe qëndrueshmëri në mendje, ku kombinimet tona neutrale ndaj karbonit janë mishërimi i dizajnit të ndërgjegjshëm për mjedisin. Përjetoni shkëlqimin si kurrë më parë me ekranin Retina që jep pamje mahnitëse dhe ngjyra të gjalla. Me një shkëlqim mbresëlënës deri në 1000 nits, faqja juaj e orës do të shkëlqejë edhe nën rrezet më të ndritshme të diellit. Në zemër të SE është S8 SiP i fuqishëm, që siguron performancë të shpejtë rrufe dhe kryerje të pandërprerë me shumë detyra. Me Siri-n gjithmonë në gatishmëri dhe telefonatë, mund ta lundroni ditën vetëm me zërin tuaj. Plus, veçoria jonë "Gjeni iPhone" siguron që nuk do ta vendosni më kurrë gabim telefonin tuaj.
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (66, 'Apple AirPods Pro 2 me MagSafe Case (USB-C)', 'Dëgjuese të nivelit të lartë të mbushura me teknologji moderne për një përvojë tingulli të akorduar vërtet në mënyrë perfekte. AirPods Pro 2022 ngasin valën e tingullit rrethues plastik që thjesht ju merr - lartësi të qarta, bas të fuqishëm dhe tone të dallueshme sa herë që dëgjoni dhe sa herë e ndizni. Pas çdo gjëje, kërkoni çipin e fuqishëm Apple H2, i cili përputhet në mënyrë të përkryer me drejtuesin dhe amplifikuesin. Dëgjueset mund të shtypin në mënyrë efektive shumicën dërrmuese të zhurmës dhe zhurmës nga mjedisi, falë të cilave ju mund të zhyteni plotësisht në dëgjim. Apple AirPods Pro 2022 do t''ju mahnitë absolutisht me tingullin rrethues që është vërtet hapësinor dhe ju rrethon nga të gjitha anët. Falë teknologjisë së ndjeshmërisë dinamike të pozicionit të kokës, dëgjueset sigurojnë shpërndarjen e saktë të çdo tingulli nga drejtimi i duhur, në mënyrë që tingulli që rezulton të jetë i përsosur.
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (67, 'Maicë Starfield - Logo (XL)', 'Përshkrimi është duke u përpunuar, ndërkohë mund të shikoni specifikat teknike, apo kontaktoni në chat, email dhe messenger për detaje të mëtutjeshme.Ju faleminderit për mirëkuptim.', '56c54a93d997464481f2525555826993.webp', 46, 13, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (68, 'Disk SSD Samsung 870 QVO, 2.5", 4TB', N'Ky është një disk i fuqishëm SSD që ofron një kapacitet prej 4 TB. Ka një format 2.5 ”. Përdor një ndërfaqe SATA 6 Gb / s për t''u lidhur me pajisjen. Përdor një memorie 4-bit MLC V-NAND. Ai arrin shpejtësi të leximit / shkrimit deri në 560/530 MB / s dhe shpejtësi të leximit / shkrimit të rastit (4KB, QD32) deri në 98,000 / 88,000 IOPS. Është i pajisur me 4 GB DDR4 SDRAM. Jeta e shërbimit të tij është 1440 TBW. Përdor kontrolluesin Samsung MKX. Ofron TurboWrite inteligjente për të shpejtuar shkrimin.
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (69, 'Çantë shpine Lenovo 1B210 për laptop 15.6", gri', 'Lenovo 15.6 B210 është një çantë për laptop me diagonale maksimale 15.6 inç. Çanta është bërë nga materiali që largon ujin. Pamja e thjeshtë e kësaj është përshtatur në mënyrë të përkryer me jetën moderne. Çanta ofron hapësirë të brendshme si për një laptop, ashtu edhe për një sërë sendesh të tjera, duke përfshirë libra dhe karikues. Për to shërbejnë një numër xhepash të brendshëm. Ndarja kryesore mund të mbyllet me një zinxhir të cilësisë së lartë. Çanta elegante mund të bartet lehtësisht falë rripave të supeve të mbushura, mund të përdoret edhe një rrip praktik. Pjesa e përparme dominohet nga një copëz me logon e Lenovo.', 'fcfa289127a84c80b74df964e596e41a.webp', 5, 18, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (70, 'Tastierë SteelSeries Apex 9 Mini, US, e zezë', 'Switchat optikë novator OptiPoint të tastierës SteelSeries Apex 9 Mini reagojnë në çast ndaj ndryshimeve të dritës dhe, të kombinuara me pikën e aktivizimit 1 mm, ju sigurojnë rezultate të larta. Përshtatuni me çdo lojë duke ndryshuar pikën e këmbëzës nga një prekje e shpejtë dhe e butë në 1 mm në një shtypje të sigurt dhe të saktë në 1.5 mm. Personalizoni, përmirësoni ose riparoni tastierën tuaj duke e zëvendësuar me llojin tuaj të preferuar të switchave OptiPoint për të krijuar një tastierë sa më komode dhe të fuqishme.
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (71, 'Kartelë grafike Zotac Gaming GeForce RTX 3060 Ti Twin Edge 8GB GDDR6X', N'Përforcohuni me serinë ZOTAC GAMING GeForce RTX™ 30 bazuar në arkitekturën NVIDIA Ampere. I ndërtuar me bërthama RT dhe bërthama tensor të përmirësuar, multiprocesorë të rinj transmetimi dhe memorie GDDR6X me shpejtësi të lartë, ZOTAC GAMING GeForce RTX 3060 Ti GDDR6X Twin Edge krijon lojëra të përforcuara me besnikëri të lartë.', 'b49575067781459fbaf1496beabd4ce6.webp', 43, 10, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (72, 'Karrige CZC.Gaming Fortress, e hirtë / zezë', 'Kjo karrikë ka dizajn ergonomik që ju ofron rehati gjatë lojërave apo punës në kompjuter. Shtresa e sipërme përbëhet nga lëkura PU ndërsa korniza është metalike. Lartësia e saj, pjesa e shpinës mund të rregullohen sipas dëshirës apo nevojës në kënde të ndryshme. Ka jastëk te pjesa e kokës si dhe regjioni lumbar apo i poshtëm shpinor, Kapaciteti mbajtës i saj është 150 kg.', 'df0f12445715420cbea871e01eb1c876.webp', 42, 20, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (73, 'Kabllo HDMI-HDMI Gembird v1.4, 1m', 'Kabllo HDMI përdor versionin 1.4 dhe ofron rezolucion Full HD 1080p. Mundëson lidhjen e laptopëve, kompjuterëve dhe konzolave të ndryshme. Kablloja ka një mburojë të trefishtë me densitet të lartë për të siguruar transmetimin e pandërprerë të sinjalit. Lidhjet janë të veshura me arë për transferimin e përsosur dhe parandalimin e oksidimit. Gjatësia e kabllos është 1m.', '7e86f705d2494293a0a71a0e622bfd85.webp', 41, 15, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (74, 'Kufje HyperX Cloud II, të zeza/ hirta', 'Përjetoni cilësi të zërit akoma më të mirë me kufjet Kingston HyperX Cloud II. Të dizajnuara me peshë të lehtë ju as që do ta vëreni se i keni ngjitur. HyperX Cloud II janë të pajisura me një konvertues dinamik të zërit, shumë të madh, 53 mm, i cili do iu ofroj zë të kristaltë. Këto kufje i reduktojnë zhurmat e jashtme në masë të madhe falë dizajnin të tij të mbyllur dhe kualitetit të lartë të jastëkëve. Kjo cilësi e zërit arrihet duke iu falënderuar intervalit të frekuencave 15 deri në 25 000 Hz dhe rezistencës prej 60 om. Kufjet kanë ndjeshmëri 98dB +/- 3dB dhe konsum të energjisë 150mW. Komunikimi online mund të bëhet me mikrofonin i cili ka ndjeshmëri të lartë dhe gamë të frekuencës 50-18,000 Hz. Kufjet kanë një port USB për lidhjen e kartelave të jashtme të zërit. Lidhja me pajisje audio ose me kompjuterë ose laptopë sigurohet nga një kabllo 1 metër e gjatë, e plotësuar me një zgjatje 2 metra. Kufjet janë të lidhura me pajisjet audio me një lidhës 3.5 mm jack.', 'bd7ce222cea54248bf126d143a2c3456.webp', 40, 5, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (75, 'Kabllo UGREEN, DVI-D (24+1), 2K@60Hz, 3m, e zezë', 'Kablloja Ethernet me shpejtësi të lartë UGREEN Cat 7 mbështet shpejtësinë e transferimit të të dhënave deri në 10 Gbps dhe gjerësi brezi 600 MHz. Pra, funksionon shumë më shpejt se CAT6, për më tepër me më pak ndërhyrje. Është zgjidhja më e mirë për të luajtur lojëra, për të transmetuar në internet ose për të shkarkuar skedarë të mëdhenj. Falë mbrojtjes së dyfishtë, kjo kabllo është shumë e besueshme, redukton ndërhyrjet dhe ofron një lidhje të qëndrueshme. Është bërë me tela bakri të pastër, duke siguruar më pak humbje me performancë të lartë. Lidhësit e veshur me ar përshtaten mirë në kabllon Ethernet dhe ofrojnë një lidhje më të shpejtë dhe më të qëndrueshme në internet. Përveç kësaj, kablloja ka kapakë pluhuri për të ndihmuar në mbajtjen e lidhësve të pastër.', 'd2012c2f77f7473c84c2c2eeecee0f6e.webp', 39, 15, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (76, 'Letër për printer Brother - DK22210', 'Brother është një kompani me një traditë të gjatë, e cila ka kohë që është e angazhuar në prodhimin e pajisjeve të printimit, të tilla si printerë, fakse, makina shkrimi dhe pajisje multifunksionale. Për produktet e saj, natyrisht, gjithashtu prodhon pajisje të ndryshme konsumuese. Avantazhi i kësaj letre në përputhje me produktet dhe cilësinë maksimale të printimit është që nuk mund të arrihet me aksesorë jo origjinal. Kjo letër për printerë Brother DK22210 me ngjyrë të bardhë është e projektuar për serinë Brother QL. Dimensionet letrës janë 29 x 30.48 mm.', 'd881aad2aed245418d2aad36386619ce.webp', 38, 14, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (77, 'Burim energjie Seasonic B12-BC-850 - 850W', 'Ky është një furnizim i besueshëm i energjisë ATX me një fuqi prej 850 W dhe një ventilator të heshtur. Ka certifikim 80 Plus Bronze, i cili siguron një efikasitet të paktën 82%. Ofron lidhje: 1x 20 + 4-pin, 2x 4 + 4-pin, 4x 6 + 2-pin, 6x SATA dhe 3x molex.', 'f99cc2ab15a04729baaebdafe652cde4.webp', 37, 10, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (78, 'Memorie RAM Kingston 8GB DDR4 3200 SO-DIMM', 'KompanitePartnere Kingston gjithmonë i përkiste dhe ende i përket ndër prodhuesit kryesorë dhe furnizuesit e moduleve të kujtesës. Falë cilësisë së lartë dhe besueshmërisë së tyre, shumë prodhues të njohur të kompjuterave i përdorin ato në seritë e tyre të modeleve dhe përdoren për të provuar pllakat amë, karta grafike, etj. Tani kjo kompani ju sjell memorien RAM SO-DIMM për laptopin tuaj. Kjo është një memorie e tipit DDR4 me një frekuencë 3200 MHz dhe një kapacitet 8 GB, e krijuar për laptopë. Koha e saj është CL22 dhe tensioni i punës prej 1.2 V.', 'df6a23fd2c1041219eddf1c933e09e1a.webp', 36, 10, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (79, 'Çantë shpine për laptop YENKEE YBB 1502 FLASHPACKER', 'Çantë shpine komode dhe praktike e përshtatshme për veshje të përditshme. Ajo siguron pajisjet e ruajtura dhe sendet personale me pajisjet e nevojshme dhe transportin e sigurt. Çanta e shpinës ofron hapësirë të mjaftueshme për të mbajtur sende personale, libra, dokumente dhe, e fundit, por jo më pak e rëndësishmja, një laptop me një diagonale maksimale prej 15.6 ", për të cilin përgatitet një xhep i mbushur me butësi. Çanta e shpinës është projektuar në tre ndarje të bollshme. Xhepi i përparmë është i pajisur me një organizator ku mbani një pamje të përgjithshme të celularit, portofolit, çelësave dhe artikujve tuaj. Ju lidhni powerbank me portin e integruar USB dhe furnizimi i nevojshëm i energjisë është gjithmonë pranë. Për udhëtime më të rehatshme, çanta e shpinës është e pajisur me një rrip për ngjitje në dorezën e bagazhit. Ajo është e bërë nga materiali i qëndrueshëm dhe i lehtë. Rripat e rregullueshëm të shpatullave së bashku me një pjesë të pasme të frymëmarrjes ofrojnë komoditetin maksimal të veshjes.', 'aeeafa92fb484539adbf2f143ad28806.webp', 45, 18, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (80, 'USB Kingston DataTraveler Exodia M - 32GB, i kaltër', '', 'f79dabb61cf546e8a15b92795de9ad11.webp', 36, 17, 'false');
INSERT INTO [dbo].[Produkti] ([ProduktiId], [EmriProduktit], [Pershkrimi], [FotoProduktit], [KompaniaId], [KategoriaId], [isDeleted]) VALUES (81, 'Lexues i kartës së memories Gembird micro SD, USB', 'Një lexues i vogël i kartave të memories microSD dhe SDHC deri në 32 GB, i cili ju lejon të lëvizni dhe kopjoni lehtësisht foto, muzikë, filma dhe skedarë të tjerë. Ai transferon të dhëna me shpejtësi deri në 25 MB / s, në varësi të klasës së shpejtësisë së kartës. Lexuesi është prej materiali të cilësisë së lartë dhe falë lidhëses me një unazë, mund ta lidhni lehtësisht te çelësat.', 'f488bea6868241ef8d05c9eaa9c23c54.webp', 41, 17, 'false');
